import React from "react";
import yourImage from "./path/to/your/image.png"; // Replace with the actual path to your image

const Loading = () => (
  <div
    style={{
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      height: "100vh",
      background: "rgba(0, 0, 0, 0.5)", // Transparent black background
    }}
  >
    <img
      src={yourImage}
      alt="Loading..."
      style={{
        width: "100px", // Adjust the width of your image
        height: "100px", // Adjust the height of your image
      }}
    />
  </div>
);

export default Loading;
